import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

ReactDOM.render(
  <React.StrictMode>
    <App name={"Hassaan Khan"}>
      <span> I will be a greta Programmer In sha Allah </span>
    </App>
  </React.StrictMode>,
  document.getElementById('root')
);

